import Pokecard from './Pokecard';
import Pokedex from './Pokedex';
import './Pokedex.css';


function App() {
  return (    
    <div className="Pokedex">
      <h2 className="Poke-title">Pokedex</h2>
      <div className="Poke-Cards">
          {Pokedex.map(i => (
              <Pokecard
                  key={i.id}
                  id={i.id}
                  name={i.name}
                  type={i.type}
                  exp={i.exp}
              />
          ))}
      </div>
    </div>
  );
}

export default App;
